import React from 'react';
import { ServiceConsumer } from '../context';

const withService = () => (Child) => {
    return (props) => {
        return(
            <ServiceConsumer>
            {
                (marketService) => {
                    return (<ChildComponent {...props} 
                        marketService={marketService}/>)
                }
            }
            </ServiceConsumer>
        )
    }
}

export default withService;
